  const [error, data, isLoading] = useFetch("localhost:3004/testimonials");
  const [testimonials, setTestimonials] = useState([]);
  useEffect(() => {
    fetchApi("http://localhost:3004/testimonials").then((data) =>
      console.log(data)
    );
    setTestimonials(data);
    console.log(testimonials);
  }, []);

  return <div>{testimonials.length}</div>;
}

